export default {
    container: {
        w: "100%",
        h: "calc(100vh - 140px)",
        alignItems: "center",
        justifyContent: "center"
    },
    balanceContainer:{
        margin: "12rem 0 3rem 5rem",
        pl:"19rem",
        pr:"4rem",
        bg:"white",
        borderRadius:"lg",
        boxShadow: "md",
        textAlign: "center"
    },
    balance:{
        fontSize: "7rem",
        fontWeight: "500",
        opacity: 0.8
    },
    title:{
        fontSize: "2xl",
        opacity:0.3,
        mb:"-1.9rem",
        mt:"1rem"
    }
}
